import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

const App = () => {
//  const pokemonList [id, pokemon] = useState([], []);
  const [pokemon, setPokemon] = useState('caterpie');
  const [pokemonData, setPokemonData] = useState([]);
  const [pokemonType, setPokemonType] = useState("");

  const getPokemonData = async () => {
    try{
      const pokeArray = [];
      const url = 'https://pokeapi.co/api/v2/pokemon/' + String.toString(1);
      const res = await axios.get(url);
      pokeArray.push(res.data);
      setPokemonType(res.data.types[0].type.name);
      setPokemonData(pokeArray[0]);
    } catch(e) {
      console.log(e);
    }
    console.log(pokemonData);
    console.log(pokemonData.name);
  }

  useEffect(() => {
    getPokemonData();
  }, []);

  return (
    <>
    <header className="header">
      <h1> Test </h1>
    </header>
    <body className="App">
      <div className="Sidebar">
        <button className="button"> A-Z </button>
        <button className="button"> Catagorized </button>
      </div>
    </body>
    </>
  );
}

export default App;
